import React, { Component } from 'react';

//props: 
// key (id)
//  id
// home
//  away
//  date
//  timezone
//  location
//  stadium      
class EventTab extends Component {
    state = {  } 
    render() { 
        return (
            <React.Fragment>
                <div>Event tab</div>
                <div>{this.props.home} vs {this.props.away}</div>
                <div>{this.props.date} | {this.props.timezone}</div>
            </React.Fragment>
        );
    }
}

export default EventTab;
